import { useState } from "react";
import Layout from "../components/layout/layout";

function Dashboard() {
  const [activeTab, setActiveTab] = useState(null);
  const position = { topbar: "flex gap-5" };
  const design = { topbar: "font-medium" };

  return (
    <Layout>
      <div className={`${position.topbar} ${design.topbar}`}>
        {["Profile", "Inbox", "Orders", "Favourites", "Settings"].map((tab) => (
          <p
            key={tab}
            className={activeTab === tab ? "text-gray-200" : ""}
            onClick={() => setActiveTab(tab === activeTab ? null : tab)}
          >
            {tab}
          </p>
        ))}
      </div>
    </Layout>
  );
}

export default Dashboard;
